    }

    render() {
        return (
            <div>
                <div className="mainContainer">
                    <div className="navBar">
                        <div className="logo">HOMINIAN</div>

                        <div className="mainLinks">
                            <div className="logo">HOMINIAN</div>
                            <div className="logo">HOMINIAN</div>
                        </div>
                    </div>
                </div>
                <style jsx>
                    {`
                        .mainContainer{
                            height: 200vh;
                            width: 100%;
                            background: white;
                        }
                        .navBar{
                            display: flex;
                            flexDirection: row;
                            justifyContent: space-around;
                            alignItems: center;
                            height: 72px;
                            width: 100%;
                            alignItems: center;
                            justifyContent: center;
                            position: sticky;
                            top: 0;   
                        }
                        .logo{
                            
                        }
                  `}
                </style>

                <style global jsx>
                    {`
                        body {
                            background:white;
                            margin: 0;
                            padding: 0;
                            border: 0;
                        }
                       
                    `}
                </style>

            </div>
        )

    }



}
